(2170,	455,	NULL,	NULL,	'<p><span>Fiory Biscottelli with apples бисквиты для птиц с яблоком</span><br /><span>Аппетитные бисквитные печенья с яблоком &ndash; прекрасное лакомство для домашних птиц.</span><br /><span>Порадуйте вашу птичку ароматными бисквитами, в состав которых входят злаки, помогающие пищеварению вашего питомца.</span><br /><span>Состав</span><br /><span>Содержат яйца, сахар, молоко, яблоки.&nbsp;</span><br /><span>Ингредиенты: злаки, яйцо и его производные (30%), сахар (27%), яблоко (4,1%), содержащиеся антиоксиданты одобрены Советом Европы.</span></p>',	NULL,	NULL,	NULL),
